import "../assets/scss/_skyz-demo.scss";

const Demo = () => {
  return (
    <div className="skyz-demo">
      <div className="navbar"></div>
      <div className="navbar__overlay"></div>

      <div className="sidebar"></div>

      <div className="main"></div>
    </div>
  );
};

export default Demo;
